import React from "react";

//components
import ImageCentered from '../components/ImageCentered'
import FeatureList from "../components/FeatureList";
import ClientLogos from "../components/ClientLogos";
import Article from "../components/Article";
import Faq from "../components/Faq";
import ImageWithText from "../components/ImageWithText";
import Panel from "../components/Panel";

//Data
import {
  references,
} from "./homeConfig"


export default function Home() {
  return (
      <>
        {/* Hero section */}
        <Article art={{
                    head:"What to do today...", 
                    body:`Manage your tasks belowxsss`}} 
                 button={{
                    exists:false, 
                    text:"", 
                    href:"/"}} 
                style={{ marginTop:"10%", }}
        />

        <ImageCentered source={"https://tailwindui.com/img/component-images/project-app-screenshot.png"} alt_str={"App screenshot"} size={1} centered={true}/>

        {/* Logo cloud */}
        <ClientLogos logos={references} />




      </>
  )
}
